import { Container, Stack } from "@mui/material";
import { Images } from "../Constants/images";
import { Search } from "@mui/icons-material";
import { useState } from "react";
import dayjs from "dayjs";
import { DemoContainer, DemoItem } from "@mui/x-date-pickers/internals/demo";
import { AdapterDayjs } from "@mui/x-date-pickers/AdapterDayjs";
import { LocalizationProvider } from "@mui/x-date-pickers/LocalizationProvider";
import { DateRangeCalendar } from "@mui/x-date-pickers-pro/DateRangeCalendar";
import { MuiPickersDay } from "@mui/x-date-pickers";

const Home = () => {
  const Styles = {
    backgroundImage: `url(${Images.BG})`,
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
    height: "100%",
    width: "100%",
  };

  const [range, setRange] = useState({
    startDate: new Date(),
    endDate: new Date(),
  });
  const [Searchval, setSearchval] = useState("");
  const [Guest, setGuest] = useState("");
  const [Room, setRooms] = useState("");
  const [value, setValue] = useState([
    dayjs("2022-04-17"),
    dayjs("2022-04-21"),
  ]);

  // Function to format the date
  const formatDate = (date) => {
    return dayjs(date).format("MMM DD YYYY");
  };

  return (
    <section className="h-[120vh] w-screen">
      <div style={Styles}>
        <Container maxWidth="lg">
          <div className="w-[100%] h-[100%] ">
            <Stack
              direction={"column"}
              style={{ width: "100%", height: "780px" }}
            >
              <div className="my-[100px]">
                <h1 className="font-hometext text-center text-7xl text-primarycolor">
                  Your journey begins here
                </h1>
              </div>
              <div className="px-[20px] ">
                <div className="absolute w-[300px] h-[100px]"></div>
                <div
                  style={{
                    width: "100%",
                    height: "650px",
                  }}
                  className="p-[30px] rounded-lg"
                >
                  <Stack direction={"column"}>
                    <div className="h-[60px] my-[10px] w-[100%] p-[10px] ">
                      <h1 className="text-2xl font-mono text-white underline">
                        All Houses
                      </h1>
                    </div>
                    <div className="h-[70px] p-[10px] bg-white rounded-lg">
                      <Stack direction={"row"}>
                        <div className="p-[10px]">
                          <Search style={{ color: "#0a0a27" }} />
                        </div>
                        <div className="w-[100%]">
                          <input
                            type="text"
                            placeholder="Search..."
                            className="bg-transparent p-[10px] w-[100%] outline-none text-xl text-primarycolor"
                          />
                        </div>
                      </Stack>
                    </div>
                    <div className="my-[20px] h-[420px] bg-white rounded-lg text-primarycolor">
                      <h1 className="text-center text-2xl font-google">
                        Check-In and Check-Out Date
                      </h1>
                      <Stack direction={"row"}>
                        <div>
                          <LocalizationProvider dateAdapter={AdapterDayjs}>
                            <DemoContainer
                              components={[
                                "DateRangeCalendar",
                                "DateRangeCalendar",
                              ]}
                            >
                              <DemoItem>
                                <DateRangeCalendar
                                  value={value}
                                  onChange={(newValue) => setValue(newValue)}
                                  renderDay={(day, value, dayState, dayModifiers) => (
                                    <MuiPickersDay
                                      {...dayProps}
                                      className="text-white"
                                    >
                                      {formatDate(day)}
                                    </MuiPickersDay>
                                  )}
                                />
                              </DemoItem>
                            </DemoContainer>
                          </LocalizationProvider>
                        </div>
                        <div className="h-[200px] w-[200px] text-xl m-[30px]">
                          <div className="p-[10px]">
                            <h1>Rooms and Guests</h1>
                          </div>
                          <hr></hr>
                          <div>
                            <Stack direction={"column"}>
                              <div className="m-[10px]">
                                <p className="mb-[10px]">Rooms</p>
                                <input
                                  type="number"
                                  onChange={(e) => setRooms(e.target.value)}
                                  className="p-[10px] border-[3px] rounded-xl outline-none border-blue-600"
                                  placeholder="Enter the Rooms"
                                />
                              </div>
                              <div className="m-[10px]">
                                <p className="mb-[10px]">Guests</p>
                                <input
                                  type="number"
                                  onChange={(e) => setGuest(e.target.value)}
                                  className="p-[10px] border-[3px] rounded-xl outline-none border-blue-600"
                                  placeholder="Enter the Guests"
                                />
                              </div>
                              <div></div>
                            </Stack>
                          </div>
                        </div>
                      </Stack>
                    </div>
                  </Stack>
                </div>
              </div>
            </Stack>
          </div>
        </Container>
      </div>
    </section>
  );
};

export default Home;
